import React from 'react';


class Music extends React.Component {
    render() {
        return (
            <div>
                <audio  src="https://ru-music.com/artist/%D1%81%D0%B5%D1%80%D0%B3%D0%B5%D0%B9-%D0%BB%D0%B0%D0%B7%D0%B0%D1%80%D0%B5%D0%B2" controls autoPlay/>
            </div>
        );
    }
}

export default Music;
